import { useEffect } from "react";

function App() {
  useEffect(()=> {
    const getTodos = async () => {
      const res = await fetch('http://localhost:3000/api/todos');
      const todos = await res.json();

      console.log(todos);
    };
    getTodos();
  },[])

  return (
    <main classname='conatiner'>
      <h1>MERN TODO</h1>
    </main>
  );
}

export default App;
